description:
Story line:
Rahul is a singer, who loses his career due to his drinking habits. He meets Arohi in a bar in Goa, where she works to earn a living. Impressed by her singing, he promises her to take her to Mumbai and make her a star, where they fall in love with each other. Aashiqui 2 is a musical love story of these lovers who goes through love and hate, fame and failure in their lives. However will they stay together accepting their success, or will they breakup due to their ego? Written by Manisha Krishna

Details

Country: India

Language: Hindi

Release Date: 26 April 2013 (India)

Box Office

Budget: INR 120,000,000 (estimated)

